import React, { useState, useEffect } from 'react'
import Header from "./components/Header";
import Nav from './components/Nav';
import { Route } from 'react-router-dom'
import ThumbnailsContainer from "./components/ThumbnailsContainer";
import VillagerDetail from './components/VillagerDetail';

function App() {
  const [villagers, setVillagers] = useState([])
  const getRandomId = () => {
    const randId = Math.ceil(Math.random() * 391)
    return (randId)
  }
  // getRandomId()
  useEffect(() => {
    const randId = getRandomId()
    console.log(randId)
    const url = `https://acnhapi.com/v1/villagers/${randId}`
    console.log(url)
    fetch(url)
      .then((res) => res.json())
      .then((json) => {
        console.log(json.name)
        console.log(typeof json.name)
        // const nameKey = Object.keys(json.name)[0]
        // console.log(nameKey)
        console.log(json.name['name-USen'])
      })
      .catch(console.error)
  }, [])

  return (
    <div>
      {/* ----homepage----- */}
      <Route path="/" exact component={Header} />
      <Route path="/" exact component={ThumbnailsContainer} />
      {/* ----detail view----*/}
      <Route path="/:id" component={Nav} />
      <Route path="/:id" component={VillagerDetail} />

    </div>
  );
}

export default App;
